A rectangular checkerboard is cut into n^3 unit squares, and when illuminated from a light source above along its axis, the board shows n^2 patterns, which are called faces.Each i-th face can be illuminated with a color of Ci.

Now I have seen several checkerboards, and I will ask you about a list L. The ith element L(i) equals to the number of visible faces for the ith checkerboard, and it equals to 0 if this is equal to a valid face. K is the number of times I will ask you. Please judge whether there is a specific checkerboard that I can tell Kth to which face it is illuminated. If the specific checkerboard does not exist, tell it to be impossible.If there are multiple checkerboards, select the one with the minimum checker board number.

